import "./App.css";

import React, { useEffect } from 'react';

const TableauChart = () => {
    let divElement;
  useEffect(() => {
    const resizeViz = () => {
      const vizElement = document.getElementById('viz1702831276024');
      const parentElement = vizElement.parentElement;
      vizElement.style.width = '100%';
      vizElement.style.height = `${parentElement.offsetWidth * 0.75}px`;
    };

    // Trigger resize when the window is resized
    window.addEventListener('resize', resizeViz);

    // Cleanup the event listener on component unmount
    return () => {
      window.removeEventListener('resize', resizeViz);
    };

    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []); // Empty dependency array to run the effect only once after initial render

  return (
    <div className='tableauPlaceholder' id='viz1702831276024' style={{ position: 'relative' }}>
      <noscript>
        <a href='#'>
          <img
            alt='Favorite Person'
            src='https://public.tableau.com/static/images/Fa/FavoritePerson/Sheet1/1_rss.png'
            style={{ border: 'none' }}
          />
        </a>
      </noscript>
      <object className='tableauViz' style={{ display: 'none' }}>
        <param name='host_url' value='https%3A%2F%2Fpublic.tableau.com%2F' />
        <param name='embed_code_version' value='3' />
        <param name='site_root' value='' />
        <param name='name' value='FavoritePerson/Sheet1' />
        <param name='tabs' value='no' />
        <param name='toolbar' value='yes' />
        <param name='static_image' value='https://public.tableau.com/static/images/Fa/FavoritePerson/Sheet1/1.png' />
        <param name='animate_transition' value='yes' />
        <param name='display_static_image' value='yes' />
        <param name='display_spinner' value='yes' />
        <param name='display_overlay' value='yes' />
        <param name='display_count' value='yes' />
        <param name='language' value='en-US' />
        <param name='filter' value='publish=yes' />
      </object>
      <script type='text/javascript'>
        var divElement = document.getElementById('viz1702831276024');
        var vizElement = divElement.getElementsByTagName('object')[0];
        vizElement.style.width = '100%';
        vizElement.style.height = `${divElement.offsetWidth * 0.75}px`;
        var scriptElement = document.createElement('script');
        scriptElement.src = 'https://public.tableau.com/javascripts/api/viz_v1.js';
        vizElement.parentNode.insertBefore(scriptElement, vizElement);
      </script>
    </div>
  );
};

export default TableauChart;
